import React, { Component } from 'react'
import { Button, Form, FormGroup, Label, Input } 
    from 'reactstrap'

export default class Login extends Component {
    render() {
        return (
            <Form className="App">
                <h1>Cripto App</h1>
                <h2>Bienvenido</h2>
                <FormGroup>
                    <label>Usuario</label>
                    <Input type="email" placeholder="Usuario"/>
                </FormGroup>
            </Form>
        )
    }
}
